import React, { useEffect, useState } from 'react'
import axios from 'axios'
const PlayerView = ({
    match: {
        params: { id },
    },
}) => {
    const [info, setInfo] = useState()
    const token = window.localStorage.getItem('token')
    console.log(token)
    useEffect(() => {
        axios
            .get(`https://jobs-xmmtw.ondigitalocean.app/player/${id}`, {
                headers: {
                    authotization: token,
                },
            })
            .then((res) => {
                setInfo(res.data)
                console.log(res)
            })
    })

    return <div>{info}</div>
}

export default PlayerView
